import './App.css';
import Square from './Components/Square';
import Board from "./Components/Board";

function App() {
  const board = ["X","X","X","X","X","X","X","X","X"]
  return (
    <div className="App">
      <Board board={board}/>
      <Square value='X' onClick={null}/>
    </div>
  );
}

export default App;
